import React, { useState } from 'react';
import {useDispatch, useSelector} from "react-redux";
import {FaBars,FaShoppingBag} from 'react-icons/fa';
import BasketIco from "./BasketIco";
import "./styles.css"
const CartList = (props) =>{
    const dispatch = useDispatch();
    const quantity = useSelector(state => state.quantity);
    return (
        <div className="container-fluid">
            <div className="row">
                <div className="d-flex align-items-start" style={{alignItems:"flex-end",justifyContent:"flex-end"}} >Bag1</div>
                <div className="col-6 align-self-start" >Bag2</div>
                {/*<div className="col-6 align-self-center"><BasketIco/></div>/*/}
            </div>
        </div>
    );
};

export default CartList;
